def maxArea(heights):
  max_area = 0
  left = 0
  right = len(heights) - 1

  while left < right:
    h = min(heights[left], heights[right])
    max_area = max(max_area, h * (right - left))
    if heights[left] < heights[right]:
      left += 1
    else: 
      right -= 1

  return max_area

