def longest_common_substring(s1, s2):
 m = len(s1)
 n = len(s2)
 lengths = [[0 for x in range(n+1)] for y in range(m+1)]
 longest = ""
 for i in range(1, m+1):
 for j in range(1, n+1):
 if s1[i-1] == s2[j-1]:
 lengths[i][j] = lengths[i-1][j-1] + 1
