 return longest

def pad_matrix(matrix, pad_size):
    rows = len(matrix)
    cols = len(matrix[0])

    new_matrix = [[0 for j in range(pad_size)] for i in range(pad_size)] 

    for i in range(rows):
        for j in range(cols):
            new_matrix[i][j] = matrix[i][j]

    return new_matrix

